import React from 'react';
import './App.css';
import { Route, Routes } from 'react-router-dom';

import Main from './pages/main.js';

const App = () => {
	return (
		<div className='App'>
			<BrowserRouter>
				<Header />
				<Routes>
					<Route path="/" element={<Main />}></Route>
				</Routes>
			</BrowserRouter>
		</div>
	);
};

export default App;
